import React from "react";

class ToDoList extends React.Component {
  render() {
    return (
        <section>
            <h1 className="m-3 ">Nouvelle Tâche</h1>
            <div className="card shadow-sm rounded">
                <form className="card-body">
                    <div className="form-group">
                        <label for="floatingInput" class="form-label" >Nom de la tâche</label>
                        <input type="text" className="form-control" id="taskName" requiredp laceholder="Entrez une tâche" />
                    </div>
                    <button type="submit" className="btn btn-primary mt-3">Ajouter</button>
                </form>
            </div>
        </section>
    )
     
  }
}
export default ToDoList;
